import React, { Component } from 'react'
import './Navbar.css';
export default class Navbar extends Component {
  render() {
    return (
      <div>
        <div className="navbar">
          <a className="navbar-brand" href="./">
            <img src="./img/seec-logo.jpg" alt=""/>
          </a>
          <ul className="nav navbar-nav">
            <li className="active">
              <a href="./">ADD</a>
            </li>
          </ul>
        </div>

      </div>
    )
  }
}
